  const location = useLocation();
  const [name, setName] = useState('');
    const [room, setRoom] = useState('');

  useEffect(() => {
    const { name, room } = queryString.parse(location.search);
    setName(name);
    setRoom(room);
  }, [location]);

  return <h1>Chat</h1>;
}

